const tasks = [
  {
    id: 1,
    text: 'Doctors Appontment',
    day: 'Oct 1st at 2:30pm',
    reminder: true,
  },
  {
    id: 2,
    text: 'Meeting at School',
    day: 'Oct 2nd at 1:30pm',
    reminder: true,
  },
  {
    id: 3,
    text: 'Food Shopping',
    day: 'Oct 1st at 2:30pm',
  },
]

const Tasks = () => {
  return (
    <>
      {tasks.map((task) => (
        <h3>{task.text}</h3>
      ))}
    </>
  )
}

export default Tasks
